import React from "react"
import styled from "styled-components"
import Button from "../buttons/Button"
import Wrapper from "../Wrapper"
import Img from "gatsby-image"
import Banner from "../Banner"
import { motion } from "framer-motion"

const HeroContainer = styled.section`
  width: 100%;
  position: relative;
  overflow: hidden;
`

const HeroBackground = styled.div`
  width: 100%;
  height: 100%;
  position: absolute;
  background: var(--green);
  z-index: -1;
  .gatsby-image-wrapper {
    position: absolute;
    width: 100%;
    height: 100%;
    object-fit: cover;
  }
  .banner-container {
    position: absolute;
    height: 100%;
    width: 100%;
    top: 0;
    .banner {
      position: absolute;
      height: 100;
      width: 1200%;
      top: 0;
      left: -50%;
      svg {
        height: 100%;
      }
    }
  }
`

const HeroFlex = styled.div`
  width: 100%;
  padding: 200px 0;
  max-width: 600px;
  color: var(--white);
  position: relative;
  h1 {
    font-size: 8rem;
    position: relative;
    span {
      position: relative;
      span {
        z-index: 2;
      }
      .infront-svg {
        position: absolute;
        top: 38%;
        left: -1%;
        width: 76%;
        z-index: 3;
      }
      .behind-svg {
        position: absolute;
        top: 20%;
        left: -1%;
        width: 76%;
        z-index: 1;
      }
    }
  }
  p {
    max-width: 400px;
    margin: 30px 0;
  }
  .button-flex {
    display: flex;
    gap: 30px;
    @media screen and (max-width: 600px) {
      flex-direction: column;
      width: 60%;
    }
  }
`

